using Components;using System;using MessagePack;using HECSFramework.Serialize;using Commands;namespace HECSFramework.Core{	[MessagePackObject, Serializable]	public partial struct CharacterComponentResolver : IResolver<CharacterComponent>, IResolver<CharacterComponentResolver,CharacterComponent>, IData	{		public CharacterComponentResolver In(ref CharacterComponent charactercomponent)		{			return this;		}		public void Out(ref Entity entity)		{			var local = entity.GetComponent<CharacterComponent>();			Out(ref local);		}		public void Out(ref CharacterComponent charactercomponent)		{		}	}}